selector_to_html = {"a[href=\"#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">One-to-One Paarung<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#id2\"]": "<aside class=\"footnote brackets\" id=\"id2\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id1\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p>Nur f\u00fcr RF Dongle mit FWVerL und anderen Versionen anwendbar. Beachten Sie, dass die Geschwindigkeit des Scanners und des Empf\u00e4ngers \u00fcbereinstimmen muss, da sonst Fehler beim \u00dcbertragen von langen Barcodes auftreten k\u00f6nnen.</p>\n</aside>", "a[href=\"#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Hohe Geschwindigkeit<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523IFSNO241.png\"><img alt=\"../../media/2523IFSNO241.png\" src=\"../../media/2523IFSNO241.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Wireless Modus</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#wireless-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Drahtlos-Modus<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Link to this heading\">#</a></h1><p>Dieser Modus verwendet die 2. GHz-Frequenzband f\u00fcr die Daten\u00fcbertragung und basiert auf Funkfrequenz-Technologie (RF) , der \u00fcber einen USB-Empf\u00e4nger mit dem Computer verbunden ist und es dem Scanner erlaubt, sich innerhalb einer bestimmten Entfernung frei zu bewegen.</p>", "a[href=\"#id10\"]": "<figure class=\"align-center\" id=\"id10\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY9.png\"><img alt=\"../../media/24USB23KEY9.png\" src=\"../../media/24USB23KEY9.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Niedrige Geschwindigkeit</span><a class=\"headerlink\" href=\"#id10\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mittlere Geschwindigkeit<a class=\"headerlink\" href=\"#medium-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Niedrige Geschwindigkeit<a class=\"headerlink\" href=\"#low-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/24RF23CH02.png\"><img alt=\"../../media/24RF23CH02.png\" src=\"../../media/24RF23CH02.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">One-to-One Paarung</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Empfangs-Tastatur\u00fcbertragungsgeschwindigkeit<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY4.png\"><img alt=\"../../media/24USB23KEY4.png\" src=\"../../media/24USB23KEY4.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Mittlere Geschwindigkeit</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY.png\"><img alt=\"../../media/24USB23KEY.png\" src=\"../../media/24USB23KEY.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Hohe Geschwindigkeit</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/25KB23SP.png\"><img alt=\"../../media/25KB23SP.png\" src=\"../../media/25KB23SP.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Empfangs-Tastatur\u00fcbertragungsgeschwindigkeit erhalten<a class=\"footnote-reference brackets\" href=\"#id4\" id=\"id3\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>2<span class=\"fn-bracket\">]</span></a></span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id4\"]": "<aside class=\"footnote brackets\" id=\"id4\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id3\" role=\"doc-backlink\">2</a><span class=\"fn-bracket\">]</span></span>\n<p>Es ist nur g\u00fcltig im drahtlosen 2.4G-Modus und wenn das empfangene Ende normal empfangen wird.</p>\n</aside>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
